      if(CheckedValues.include(e.target.value)){
        setCheckedValues(
          CheckedValues.filter((checkedValue)=>
           checkedValue !==e.target.value)
        );
      }else{
        setCheckedValues([...CheckedValues,e.target.value]);
      }
    };
    return (
      <div className="App">
        <p>
          現在選択されている画面値: <b></b>
        </p>
      </div>
    )
  }

